// Footer.js
import './footer.css';
import React from 'react';
import { Link } from 'react-router-dom';

const Footer = () => {
  return (
    <><div className='background'></div><div className='formlink'>
          <Link to='https://www.facebook.com/'>Say Hello</Link>
      </div></>
  );
};

export default Footer;
